import React from 'react';

const Accordion = ({ items }) => {
    return (
        items.map(item => {
            return <div>
                        <div className='greet color-yellow active'>
                            <i className='dropDown icon'></i>
                            {item.item}
                        </div>
                        <div className='white description active'>
                            <p>{item.content}</p>
                        </div>
                </div>
        })
    )
};

export default Accordion;
